use fandango;

CREATE TABLE `TICKET_ORDER`
(
  order_id      BIGINT PRIMARY KEY AUTO_INCREMENT,
  schedule_id   BIGINT,
  user_id       INTEGER,
  ticket_num    INTEGER,
  order_total   DECIMAL(6, 2),
  tax           DECIMAL(4, 2),
  grand_total   DECIMAL(6, 2),
  order_ts      DATETIME,
  order_date    DATE,
  order_month   DATE,
  status        INTEGER DEFAULT 1,
  FOREIGN KEY (schedule_id) REFERENCES SCHEDULE (schedule_id),
  FOREIGN KEY (user_Id) REFERENCES USER (user_id)
);


SET autocommit = 0;

commit;

update TICKET_ORDER
set
  order_total = ticket_num * 12.5,
  tax = ticket_num * 12.5 * 0.07,
  grand_total = ticket_num * 12.5 * 1.07,
  order_date = date(order_ts),
  order_month = date_format(order_ts, '%Y-%m-01'),
  status = 2;
